import React from "react";
import "./Checkout.css";

function Checkout() {
	return (
		<div className="checkout">
			<div className="chechout__left">
				<img
					className="checkout__ad"
					alt="chechoutAdImg"
					src="https://m.media-amazon.com/images/I/81jwrgyJDXL._SS100_.jpg"
				/>
			</div>
			<div className="chechout__right"></div>
		</div>
	);
}

export default Checkout;
